import React from 'react';
import './HomeCss.css'
const Home = () => {
    return (
        <div>
            <div className="nav-bar">
                {/* here is our logo section */}
                <div className="logo">
                    <h1>TRIPPY.</h1>
                </div>
                {/* here is our Link Section */}
                <div className="links">
                    <ul>
                        <li>HOME</li>
                        <li>ABOUT</li>
                        <li>SERVICES</li>
                        <li>CONTACT</li>
                    </ul>
                </div>
                {/* login button */}
                .log
            </div>
        </div>
    );
}

export default Home;
